<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8" />
<title>Kyla's Confections</title>
<meta name="viewport" content="width=device-width, initial-scale=1.0" />
<style>
  :root {
    --bg:#f5efe6;
    --card:#ffffff;
    --title:#5d3a1a;
    --text:#4e3b2b;
    --button-bg:#7f5f3d;
    --button-text:#fff;
    --button2-bg:#d8c8b0;
    --button2-text:#5d3a1a;
    font-family: -apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,Oxygen,Ubuntu,Cantarell,"Open Sans","Helvetica Neue",sans-serif;
  }
  body {
    margin:0;
    background: linear-gradient(135deg, #f5efe6 0%, #e8e0d4 100%);
    color: var(--text);
    display:flex;
    min-height:100vh;
    align-items:center;
    justify-content:center;
    padding:1rem;
  }
  .container {
    background: var(--card);
    max-width:500px;
    width:100%;
    border-radius:16px;
    box-shadow:0 20px 60px -10px rgba(93,58,26,0.35);
    padding:2rem 1.5rem 2.5rem;
    text-align:center;
    position:relative;
  }
  .logo {
    width:160px;
    height:auto;
    margin:0 auto 1rem;
  }
  h1 {
    margin:0.25rem 0;
    font-size:2.2rem;
    color: var(--title);
    font-family: "Brush Script MT", cursive, -apple-system,BlinkMacSystemFont,"Segoe UI";
    letter-spacing:0.5px;
  }
  p.tagline {
    margin:0.5rem 0 1.5rem;
    font-size:1rem;
  }
  .buttons {
    display:flex;
    gap:1rem;
    flex-wrap:wrap;
    justify-content:center;
    margin-top:1rem;
  }
  .btn {
    flex:1;
    min-width:140px;
    padding:0.75rem 1rem;
    border:none;
    border-radius:10px;
    font-size:1rem;
    cursor:pointer;
    font-weight:600;
    text-decoration:none;
    display:inline-flex;
    align-items:center;
    justify-content:center;
    gap:6px;
    transition:transform .13s ease;
  }
  .btn-facebook {
    background: var(--button-bg);
    color: var(--button-text);
  }
  .btn-facebook:hover {
    transform:scale(1.04);
  }
  .btn-instagram {
    background: var(--button2-bg);
    color: var(--button2-text);
  }
  .btn-instagram:hover {
    transform:scale(1.04);
  }
  .footer {
    font-size:0.7rem;
    margin-top:1.5rem;
    color:#8b7e70;
  }
  @media (max-width:600px){
    h1{font-size:1.9rem;}
  }
</style>
</head>
